import React from 'react';
import { Slide } from 'react-slideshow-image';
import '../stylesheets/slider.css';
import slider1 from '../images/slider1.jpg';/*/static/media/slider1.ff0b32f3.jpg*/
import slider2 from '../images/slider2.jpg';/*/static/media/slider2.b420343f.jpg slider.js:31*/
import slider3 from '../images/slider3.jpg';
import slider4 from '../images/slider4.jpg';
import slider5 from '../images/slider5.jpg';

const slideImages = [
    '/static/media/slider1.ff0b32f3.jpg',
    slider2,
    {src : '/static/media/slider1.ff0b32f3.jpg'},
    {src : '../images/slider1.jpg'}
];

const properties = {
    duration: 2000,
    transitionDuration: 500,
    infinite: true,
    indicators: true,
    arrows: true,
    pauseOnHover: true,
    onChange: (oldIndex, newIndex) => {
        console.log(`slide transition from ${oldIndex} to ${newIndex}`);
    }
}

const Slideshow = () => {
    return (
        <div className="slide-container">
            {console.log(slider1)}
            {console.log(slider2)}
            {console.log(slider3)}
            {console.log(slider4)}
            {console.log(slider5)}
            {console.log(slideImages[0])}
            <Slide {...properties}>
                <div className="each-slide">
                    <img src={slider1} width="100%" height="100%"/>
                </div>
                <div className="each-slide">
                    <img src={slider2} width="100%" height="100%"/>
                </div>
                <div className="each-slide">
                    <img src={slideImages[0]} width="100%" height="100%"/>
                </div>
                <div className="each-slide">
                    <img src={slideImages[1]} width="100%" height="100%"/>
                </div>
                <div className="each-slide">
                    <img src={slideImages[2].src} width="100%" height="100%"/>
                </div>
                <div className="each-slide">
                    <div >
                        <span>Slide 3</span>
                    </div>
                </div>
            </Slide>
        </div>
    )
}

export default Slideshow;
